#### Definitions

**1**   In this Act:

**"aquatic plants"** includes any parts, products or by-products of these plants;

**"commodity"** means a product derived from plants or animals, including parts, products or by-products, and fish or aquatic plants, that are raised or gathered for profit;

**"council"** means a council established under section 2;

**"fish"** means an aquatic animal, including aquatic invertebrates, and any parts, products or by-products of such an animal;

**"fund"** means a fund established under section 2;

**"producer"** includes a gatherer of plants or animals.

#### Power to make regulations

**10**   (1) The Lieutenant Governor in Council may make regulations referred to in section 41 of the [*Interpretation Act*](https://www.bclaws.gov.bc.ca/civix/document/id/complete/statreg/96238_01).

(2) Without limiting subsection (1), the Lieutenant Governor in Council may make regulations as follows:

(a) establishing the time and manner for payment of a levy established under section 4 (1);

(b) requiring one or more of the following persons to collect the levy established under section 4 (1) in the manner and within the time prescribed and to remit the amount collected, less any prescribed commission, to a prescribed person in the manner and within the time prescribed:

(i)  a producer of the commodity;

(ii)  a distributor of the commodity;

(iii)  the first person who purchases the commodity from the producer;

(iv)  a person who supplies goods or services to the producer;

(v)  any other person involved in the production, processing, distribution or retailing of the commodity;

(c) authorizing a council to charge interest, at a rate determined by the council from time to time, on an amount that has not been remitted within the time prescribed under paragraph (b);

(d) respecting section 4 (2);

(e) exempting a class of producers from payment of a levy, a class of levy or all levies;

(f) providing for refunds of levies;

(g) establishing practices and procedures for a council;

(h) requiring a council to report particulars of its operations in a manner and at times specified by the regulations;

(i) respecting the minimum requirements referred to in section 2 (3);

(j) respecting the calling of annual general meetings by a council and the matters required to be dealt with and the conduct of business and votes at those meetings;

(k) respecting business plans and operational guidelines for councils;

(l) respecting the election of council members;

(m) respecting procedures that can be used by persons who are entitled to vote at annual general meetings to dissolve a council and distribute the fund and the council's assets;

(n) respecting a plan, including implementing a proposal in a plan.

(3) A regulation made under subsection (1) or (2) may

(a) make different provisions for different commodities, councils, classes of producers or persons who may be subject to a levy,

(b) authorize a council or person to exercise a discretionary power, and

(c) delegate a matter to a council or person.

(4) The Lieutenant Governor in Council may make regulations

(a) authorizing a council to exercise a power or perform a duty conferred on it under an Act or regulation of Canada, and

(b) granting to an entity established by an Act or regulation of Canada some or all of the powers and duties that a council has under this Act or that a council may be given by a regulation made under this Act.
